description:
Смеситель однорычажный для раковины. Монтаж: на одно отверстие. Керамический картридж 28 мм. С ограничителем температуры. Регулируемый аэратор. Хромированная поверхность. Поворотный излив с аэратором и стопором. Металлический рычаг. Минимальное давление 1,0 бар.
Комплектация:
Поворотный излив с аэратором и стопором;
Сливной гарнитур 1 1/4"";
Гибкая подводка;
GROHE QuickFix™ Plus Монтажная система;
Металлический рычаг

Размер: 127 x 127 мм (каждый модуль);
Два динамика со штепсельной вилкой;
Защита от влаги и коррозии;
GROHE StarLight® хромированная поверхность
Требуется встраиваемый блок 29 073 000 - заказывается отдельно.
Материал - латунь.
Цвет - хром.

Совместима со всеми видами подвесных унитазов;
Подходит для легких и несущих стен;
Рама испытана нагрузкой 400 кг;
Фановый отвод для слива, регулируемый по глубине;
Легкость и быстрота установки;.
Регулируется по высоте от 0 до 200мм.

В комплекте:
Крепежные элементы для унитаза;
Крепежные элементы для рамы;
Комплект соединительных патрубков для унитаза;
Фановый отвод для слива и переходник ø90/110;
G1/2” запорный клапан.

Технология Olipure
Особенностью данной инсталляции является монтируемый внутрь бачка резервуар на 450 мл, соединённый со смывным клапаном. Резервуар заполняется ароматизированным средством, 2 грамма которого добавляются в воду при каждом сливе.
Клавиша монтируется на специальном поворотном кронштейне, что облегчает доступ к клапану резервуара.

Механическая система двойного слива;
Предназнаены для системы OLIpure;
Сила нажатия < 20 N;
Толщина - 6.5мм;
Открывание и закрывание с системой «Click»;
Панель слива из АБС-пластика;
Высокая устойчивость к царапинам;
Возможно покрытие Soft-touch (ST);
2 года гарантии.

